import { BaseError } from "../../config/baseError.js";
import { insertUserSql } from "./memberSQL.js";
import { confirmEmail,getUserID } from "./memberSQL.js";
import { pool }  from '../../config/db.js';

//memberDAO.js
// User 데이터 삽입
import { errStatus } from "../../config/errorStatus.js";

export const addUser = async (data) => {
    try {
        const conn = await pool.getConnection();
    
        const [confirm] = await pool.query(confirmEmail, data.email);

        if (confirm[0].isExistEmail) {
            conn.release();
            return -1;
        }

        const result = await pool.query(insertUserSql, [data.email, data.name, data.gender, data.birth, data.addr, data.specAddr, data.phone]);

        conn.release();
        return result[0].insertId;

    } catch (err) {
        throw new BaseError(errStatus.INTERNAL_SERVER_ERROR);
    }
}

// 사용자 정보 얻기
export const getUser = async (userId) => {
    try {
        const conn = await pool.getConnection();
        const [user] = await pool.query(getUserID, userId);
        if (user.length == 0) {
            return -1;
        }

        conn.release();
        return user;

    } catch (err) {
        throw new BaseError("error");
    }
}

